import React from 'react'
import ArtCard from './ArtCard'
import AcquisitionCard from './AcquisitionCard'

// function ArtList({ artworks, user, onDeleteArtwork, onUpdateArtwork, onDeleteAcquisition }){
function StorageList({ 
    artworks, 
    currentUser, 
    onDeleteArtwork, 
    acquisitions, 
    setAcquisitions, 
    onUpdateArtwork,
    onDeleteAcquisition
}){
  console.log(currentUser.artworks)
    let myArtworksList =
    currentUser.artworks.map((artwork) => {
        return <ArtCard 
            key={artwork.id} 
            currentUser={currentUser} 
            artwork={artwork}
            acquisitions={acquisitions}
            onDeleteArtwork={onDeleteArtwork}
            onUpdateArtwork={onUpdateArtwork}
            />
    })
    let myAcquisitionsList =
    currentUser.acquisitions.map((acquisition) => {
        return <AcquisitionCard 
            key={acquisition.id} 
            currentUser={currentUser} 
            artwork={artwork}
            acquisitions={acquisitions}
            onDeleteArtwork={onDeleteArtwork}
            onUpdateArtwork={onUpdateArtwork}
            />
    })
    return(
        <div className="art-list">
            {myArtworksList}
        </div>
    )
}

export default StorageList;
